original_question:
Trekant $ABC$ er ligebenet, med $AB=AC$ og højden $AM=11.$ Antag, at der er et punkt $D$ på $\overline{AM}$ med $AD=10$ og $\angle BDC=3\angle BAC.$ Find omkredsen af trekant $ABC.$

[asy]
unitsize(0.4 cm);

pair A, B, C, D, M;

A = (0,11);
D = (0,1);
B = (-11/2,0);
